INSERT INTO SPR_PO
	VALUES ("a3bc244e-ec4d-41ac-bb9d-872322e5a5c8",
	'executeOpTest',
	'',
	'// Main test entry point
LOG::LogInfo(message:"Test Provider::executeOpTest() entered");
testArray[0] = 1;
select any testClass from instances of TST;
if empty testClass
  create object instance testClass of TST;
end if;
testClass.test_sdt_a.simple_m = 2;
testClass.test_sdt_a.array_m[0] = 3;
testClass.test_sdt_a.sdt_m.simple_m = 4;
testClass.test_sdt_a.sdt_m.string_m = "execute";
testClass.cache = sender;
testI = 0;
send same::pingRequirer(simpleBV_p:0,
                       simpleBR_p:testI,
                       arrayBV_p:testArray,
                       arrayBR_p:testArray,
                       sdtBV_p:testClass.test_sdt_a,
                       sdtBR_p:testClass.test_sdt_a, name:param.name) to sender;
send different::replyToRequirer(senderName:"execute") to sender;
// Check by reference values
if testI != 1
  LOG::LogFailure(message:"By reference argument not updated");
  LOG::LogInteger(message:testI);
end if;
if testArray[0] != 2
  LOG::LogFailure(message:"By reference array argument not updated");
  LOG::LogInteger(message:testArray[0]);
end if;
if testClass.test_sdt_a.simple_m != 3
  LOG::LogFailure(message:"By reference SDT member integer argument not updated");
  LOG::LogInteger(message:testClass.test_sdt_a.simple_m);
end if;
if testClass.test_sdt_a.array_m[0] != 4
  LOG::LogFailure(message:"By reference SDT member array argument not updated");
  LOG::LogInteger(message:testClass.test_sdt_a.array_m[0]);
end if;
if testClass.test_sdt_a.sdt_m.simple_m != 5
  LOG::LogFailure(message:"By reference SDT member SDT member integer argument not updated");
  LOG::LogInteger(message:testClass.test_sdt_a.sdt_m.simple_m);
end if;
if testClass.test_sdt_a.sdt_m.string_m != "execute, pingRequirer"
  LOG::LogFailure(message:"By reference SDT member SDT member string argument not updated");
  LOG::LogInfo(message:testClass.test_sdt_a.sdt_m.string_m);
end if;
result = same::getResultFromRequirer(name: "execute");
if result != 2
  LOG::LogFailure(message:"Unexpected return value from Requirer, expected 2 got:");
  LOG::LogInteger(message: result);
end if;
arrayResult = same::getArrayFromRequirer(name: "execute");
if arrayResult[0] != 2
  LOG::LogFailure(message: "Unexpected return array value from Requirer, expected 2 got:");
  LOG::LogInteger(message: arrayResult[0]);
end if;
sdtResult = same::getSDTFromRequirer(name: "execute");
if sdtResult.simple_m != 4
  LOG::LogFailure(message:"Unexpected return SDT member integer value, expected 4, got:");
  LOG::LogInteger(message:sdtResult.simple_m);
end if;
if sdtResult.array_m[0] != 5
  LOG::LogFailure(message:"Unexpected return SDT member array value, expected 5, got:");
  LOG::LogInteger(message:sdtResult.array_m[0]);
end if;
if sdtResult.sdt_m.simple_m != 6
  LOG::LogFailure(message:"Unexpected return SDT member SDT member integer value, expected 6, got:");
  LOG::LogInteger(message:sdtResult.sdt_m.simple_m);
end if;
if sdtResult.sdt_m.string_m != "execute, pingRequirer, getSDTFromRequirer"
  LOG::LogFailure(message:"Unexpected return SDT member SDT member string value, expected ->execute, pingRequirer, getSDTFromRequirer<-, got:");
  LOG::LogInfo(message:sdtResult.sdt_m.string_m);
end if;
